import React, { Component } from 'react';

const QRDecoderMain: React.FC = props => {
  const iframeContainerContainerStyle = {
    height: '100%',
    overflowY: 'hidden',
  };

  const iframeContainerStyle = {
    position: 'relative',
    width: '100%',
    // height: 'calc(100% - 56px)',
    // top: '56px'
    height: 'calc(100% + 1px)',
    top: '-1px'
  };

  const iframeStyle = {
    width: '100%',
    height: '100%',
  };

  return <div style={iframeContainerContainerStyle} {...props}>
    <div style={iframeContainerStyle}>
      <iframe
        title='QR code decoder page'
        aria-label='QR code decoder page'
        aria-labelledby='QR code decoder page'
        style={iframeStyle}
        sandbox='allow-scripts allow-same-origin'
        src='https://mudev.cc/qrdecode' />
    </div>
  </div>;
}

export { QRDecoderMain };
